import React, {Component} from 'react';
import {Container, Row, Col, Card, Button} from 'react-bootstrap';
import Top from './Top';

class App extends Component {
  render(){
  return (
    <div>
      <Top/>
    <Container>
      <Row className="mt-5">
        <Col>
        <Card style={{ width: '10rem' }}>
          <Card.Img variant="top" src="https://images.unsplash.com/photo-1544716278-ca5e3f4abd8c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=2767&q=80" />
          <Card.Body>
            <Card.Title>Card Title</Card.Title>
            <Card.Text>
              Some quick example text to build on the card title and make up the bulk of
              the card's content.
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
      </Card>
        </Col>
      </Row>
    </Container>
    </div>
  );
}
}

export default App;
